import React from 'react';
import './TestComponent.css';
import { Form } from 'react-bootstrap';

function TestComponent() {
  return (
<Form.Group>
<Input type='text' label='Input Large' bsSize="large" placeholder='Large' />
<Input type='text' label='Input Normal' placeholder='Normal' />
<Input type='text' label='Input Small' bsSize="small" placeholder='Small' />
</Form.Group>
  );
}

export default TestComponent;
